    <title>React Store</title>
  <script defer="defer" src="React%20Store_files/bundle.js"></script><style>* {
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", "Roboto", "Oxygen", "Ubuntu", "Cantarell", "Fira Sans", "Droid Sans", "Helvetica Neue", sans-serif;
}

body {
  margin: 0;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", "Roboto", "Oxygen", "Ubuntu", "Cantarell", "Fira Sans", "Droid Sans", "Helvetica Neue", sans-serif;
  background-color: #e7f6ff;
}

.wrapper {
  background: #ffffff;
  box-shadow: 0px 10px 20px rgba(0, 0, 0, 0.04);
  border-radius: 20px;
  max-width: 1080px;
  max-height: 1500px;
  margin: 50px auto;
}

header {
  border-bottom: 1px solid #eaeaea;
}
header p,
header h3 {
  margin: 0;
}
header .logo {
  width: 40px;
  height: 40px;
}
header .headerRight {
  list-style: none;
}

.content .card {
  width: 210px;
  border-radius: 25px;
  border: 1px solid #eaeaea;
  background-color: #ffffff;
  padding: 20px;
}
.content .card .cardImage {
  width: 133px;
  height: 112px;
  margin: 0 auto;
  margin-bottom: 20px;
}
.content .card .cardFavButton,
.content .card .cardAddButton {
  box-sizing: border-box;
  background: #ffffff;
  border: 1px solid #f2f2f2;
  box-sizing: border-box;
  border-radius: 8px;
  width: 32px;
  height: 32px;
  cursor: pointer;
}
.content .card .cardFavButton img,
.content .card .cardAddButton img {
  margin-top: 4px;
}
.content .card h5, .content .card h3, .content .card p, .content .card b {
  margin: 0;
}
.content .card h3 {
  margin-bottom: 14px;
}
.content .card h5 {
  font-size: 17px;
}
.content .card p {
  opacity: 0.5;
  text-transform: uppercase;
}
.content .card b {
  font-size: 15px;
}
.content .search-block {
  border: 1px solid #F3F3F3;
  border-radius: 10px;
  height: 45px;
  width: 250px;
  padding: 10px;
}
.content .search-block input {
  border: 0;
  padding: 10px;
  font-size: 16px;
}
